import React from "react";

const SelectSearch = () => {
  return (
    <div className="selectSearch-container">
      <form>
        <select>Used Cars</select>
        <select>Any Makes</select>
        <select>Any Models</select>
        <select>All Prices</select>
        <button type="submit ">Search Icon</button>
      </form>
    </div>
  );
};

export default SelectSearch;
